import React from 'react';
import './quizsettings.css';

class QuizSettings extends React.Component {
  

  render () {
    return (
    <div className="centered" id="main-Container">
        <div class="button button-4"><p>Hover me!</p></div>
      </div>
    );
  }
}

export default QuizSettings;
